import db from '../public/db.json'
import OperatorTile from "../components/operatorTileComponent/OperatorTile";




const MainPage = ( { data } ) => {

    const [...operatorsData] = data

    console.log(operatorsData)

    return (
        <div>
            {operatorsData.map((id)=> {
                <OperatorTile
                    key={operatorsData.id}
                    props={operatorsData}
                />
            })}
           <pre>
               {JSON.stringify(data, null, 4)}
           </pre>
        </div>
    )

}

MainPage.getInitialProps = () => {
    return {data : db}
}

export default MainPage
